def holder = new com.eviware.soapui.support.XmlHolder( mockRequest.requestContent )

def weight = Float.parseFloat(holder["//weight"].replace(",", "."))
def height = Float.parseFloat(holder["//height"].replace(",", "."))
def bodyMassIndex = weight / Math.pow(height / 100, 2)
requestContext.bodyMassIndex = Math.round(bodyMassIndex*100)/100

return "response"

